CKYTCR(
  const amrex::Real rho,
  amrex::Real /*T*/,
  const amrex::Real y[],
  amrex::Real c[])
{

  for (int i = 0; i < 39; i++) {
    c[i] = rho * y[i] * imw(i);
  }
}

