  XW += x[12] * 29.018000; // HCO
  XW += x[13] * 30.026000; // CH2O
  XW += x[14] * 31.034000; // CH3O
  XW += x[15] * 32.042000; // CH3OH
  XW += x[16] * 28.010000; // CO
  XW += x[17] * 44.009000; // CO2
  XW += x[18] * 26.038000; // C2H2
