  pertT = 1e-2;
  T_pert1 = T + pertT;

  const amrex::Real invT_pert1 = 1.0 / T_pert1;
  const amrex::Real logT_pert1 = log(T_pert1);
  productionRate_light(
    wdot_pert1, sc, g_RT, g_RT_qss, sc_qss, kf_qss, &J[0], &J[70], T_pert1,
    invT_pert1, logT_pert1);
