  // Species terms
  amrex::Real x2 = sc[10] + sc[12] + sc[13] + sc[14] + sc[15] + sc[19] + sc[1] +
                   sc[21] + sc[23] + sc[24] + sc[25] + sc[26] + sc[27] +
                   sc[28] + sc[29] + sc[2] + sc[30] + sc[31] + sc[32] + sc[33] +
                   sc[34] + sc[35] + sc[36] + sc[37] + sc[38] + sc[3] + sc[4] +
                   sc[5] + sc[8] + sc[9];
  amrex::Real x6 =
    2 * sc[11] + 1.5 * sc[16] + 2 * sc[17] + 3.0 * sc[22] + 6.0 * sc[7];
  const amrex::Real x8 =
    sc[0] + 2.5 * sc[18] + 2.5 * sc[20] + 2 * sc[6] + x2 + x6;
  amrex::Real x10 = -g_RT[18] + g_RT_qss[4];
  amrex::Real x11 = -25009.8682904946 * invT - 0.64 * logT;
  amrex::Real x15 = 2450000000.0 * x8 * exp(x11);
  amrex::Real x17 = (1.0 / ((1.0 + x15 / kf_qss[5])));
  amrex::Real x18 = x17 * exp(x10 + x11);
  const amrex::Real x22 = exp(-g_RT[19] - g_RT[2] + g_RT[6] + g_RT_qss[4]);
  const amrex::Real x25 = -g_RT[20] + g_RT[6] + g_RT_qss[4];
  amrex::Real x26 = -50251.216247259297 * invT - 9.31 * logT;
  const amrex::Real x32 = 0.7 * sc[0] + sc[18] + sc[20] + 2 * sc[6] + x2 + x6;
  amrex::Real x35 = 7.0e+44 * exp(x26);
