  // species 0: AR
  // Imported from NIST
  Tci[0] = 150.860000;
  ai[0] = 1e6 * 0.42748 * Rcst * Rcst * Tci[0] * Tci[0] /
          (39.948000 * 39.948000 * 48.980000);
